import RequestListing from './RequestListing'
import Loader from './Loader'


const ModalContent = props => {
  switch (props.content) {
    case "listingRequest":
      return <RequestListing formFields={props.formFields} handleChange={props.changeFormFields} handleSubmit={props.submitForm} />
    case "loader":
      return <Loader />
  }

}

export default ModalContent
